import {
  createApp,
  ref,
  reactive,
  onMounted,
  nextTick
} from "https://esm.sh/vue@3/dist/vue.esm-browser.js";

import QRCodeStyling from "https://esm.sh/qr-code-styling@1.9";
import { loadIcon } from "https://esm.sh/iconify-icon@3/dist/iconify-icon.min.js";
import { getIconCSS } from "https://esm.sh/@iconify/utils";


const isWebKit = /AppleWebKit/.test(navigator.userAgent) && !/Chrome\/|Chromium\/|Edg\//.test(navigator.userAgent); // returns true or false

const profileData = {
  image: `data:image/png;base64,` // very long string here
};

const profileImage = profileData.image;


// Your service records
const services = [
  /*
  {
    name: "Bitcoin",
    color: "#f7931a",
    icon: "bxl:bitcoin",
    address: "bc1q6z4nspyadq0sdq3vkcdtxxzwlywfva557wfqsm0h5g5xnnzrmpdq4cmhe6",
    qrValue: "bc1q6z4nspyadq0sdq3vkcdtxxzwlywfva557wfqsm0h5g5xnnzrmpdq4cmhe6"
  },
  */
    {
    name: "Venmo",
    color: "#3d95ce",
    icon: "grommet-icons:venmo",
    handle: "icecreamsongs",
    qrValue: "https://venmo.com/u/icecreamsongs",
    link: "https://venmo.com/u/icecreamsongs"
  },
  {
    name: "Cash App",
    color: "#00d632",
    icon: "simple-icons:cashapp",
    cashtag: "$icecreamsongs",
    qrValue: "https://cash.app/$icecreamsongs",
    link: "https://cash.app/$icecreamsongs"
  },
  /*
  {
    name: "PayPal",
    color: "#003087",
    icon: "mage:paypal",
    handle: "@GiveToArtist",
    qrValue: "https://paypal.me/GiveToArtist",
    link: "https://paypal.me/GiveToArtist"
  },
  {
    name: "Ko-fi",
    color: "#29abe0",
    icon: "simple-icons:kofi",
    handle: "kofi.com/GiveToArtist",
    qrValue: "https://ko-fi.com/GiveToArtist",
    link: "https://ko-fi.com/GiveToArtist"
  },
  {
    name: "Zelle",
    color: "#6c2dc7",
    icon: "simple-icons:zelle",
    address: "email@example.com",
    qrValue: "mailto:email@example.com"
  } 
  */
];


const faceNames = ["front", "right", "back", "left", "top", "bottom"];

const app = {
  setup() {
    const currentRotation = ref("rotateY(0deg)");
    const qrRefs = reactive([]);
    const profileImageRef = ref(profileImage); // store it in Vue
    
    const fullName = ref("Lionel Jean-Baptiste");
    const handle = ref("@icecreamsongs");

    const rotate = (index) => {
      const rotations = [
        "rotateY(0deg)", // front
        "rotateY(-90deg)", // right
        "rotateY(-180deg)", // back
        "rotateY(90deg)", // left
        "rotateX(-90deg)", // top
        "rotateX(90deg)" // bottom
      ];
      currentRotation.value = rotations[index] || "rotateY(0deg)";
    };

    const copy = (text) => navigator.clipboard.writeText(text);
    

    onMounted(async () => {
      
      for (let i = 0; i < services.length; i++) {
        const service = services[i];
        try {
          
          if(isWebKit) {
            
            var type = "canvas";
            var image = false;
            
          } else {
            
            var type = "svg";
            
            const icon = await loadIcon(service.icon);

            // Generate CSS
            const css = getIconCSS(icon, { color: "white" });

            // Regex to capture the URL within background-image: url('...')
            const regex = /background-image:\s*url\(['"](data:image\/svg\+xml,.*?)\s*['"]\);/;
            const match = css.match(regex);
            const dataImageUrl = match[1].trim();

            const dataImageString = dataImageUrl.replace(
              /^url\(['"](.*)['"]\)$/,
              "$1"
            );
            
            var image = dataImageString;

            // console.log(dataImageString)

          }

          const qr = new QRCodeStyling({
            width: 150,
            height: 150,
            type, // use "svg" or "canvas"
            data: service.qrValue,
            image,
            dotsOptions: {
              color: "#ffffff",
              type: "dots"
            },
            cornersSquareOptions: { type: "dot" },
            cornersDotOptions: { type: "dot" },
            backgroundOptions: { color: null },
            imageOptions: {
              crossOrgin: "anonymous",
            }
          });     
 
          qr.append(qrRefs[i]);
        
        } catch (err) {
          console.error(`Failed to generate QR for ${service.name}:`, err);
        }
      }
    });

    return {
      services,
      faceNames,
      currentRotation,
      rotate,
      copy,
      qrRefs,
      profileImage: profileImageRef,
      fullName,
      handle
    };
  }
};

createApp(app).mount("#app");

